INSERT INTO `article` (`id`, `title`, `content`, `created_at`, `updated_at`, `extra`, `type`) VALUES
(24, '邀请攻略', '<p></p><p></p><p></p><p class=\"MsoNormal\" align=\"center\"><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"><font face=\"宋体\">邀请返钱规则</font><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"></spanyes></spanyes></p><p></p><p></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;\"><span>1、</span></span><!--[endif]--><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"><font face=\"宋体\">自己注册成为麦达汇粉丝用户之后，每分享一位好友注册麦达汇，您都可以得到一定数量的现金或麦穗。</font><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"></spanyes></spanyes></p><p></p><p></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;\"><span>2、</span></span><!--[endif]--><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"><font face=\"宋体\">自己成为麦达汇合伙人之后，自己邀请的好友注册麦达汇后所有在麦达汇平台的消费（不包括限时特惠、麦穗抵扣、抽奖商品）都跟您有关系，好友消费，您返利；</font><spanyes mso-bidi-font-family:=\"\" new=\"\" roman=\"\"></spanyes></spanyes></p><p></p><p></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri;\r\nmso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;\"><span>3、</span></span><!--[endif]--><spanyes mso-hansi-font-family:calibri=\"\" new=\"\" roman=\"\" mso-font-kerning:1.0000pt=\"\"><font face=\"宋体\">成为麦达汇合伙人之后，可通过邀请好友注册麦达汇平台进行升级，邀请好友注册越多，您得到的返利越多；</font><spanyes mso-bidi-font-family:=\"\" new=\"\" roman=\"\"></spanyes></spanyes></p><p></p><p></p><p><!--[if gte mso